import React from 'react';
import { createUseStyles } from 'react-jss';

const useStyles = createUseStyles({
	image: { objectFit: 'cover', cursor: 'pointer' },
});

const PhotoListDetail = ({ urls, description }) => {
	const classes = useStyles();

	const renderDetail = () => {
		return (
			<noscript className="loading-lazy">
				<img className={classes.image} src={urls} alt={description} loading="lazy" style={{width: '100%', height: '100%'}}/>
			</noscript>
		);
	};
	/* TODO: spinner if no image data */
	if (urls) {
		return renderDetail();
	} else {
		return <span>No images yet</span>;
	}
};

export default PhotoListDetail;
